(10, '2017-06-21 03:04:00', 3, 'Protecting the Universe From Pirate Scum', '', '', 0),
(11, '2017-06-21 03:05:24', 3, 'Protecting the Universe From Pirate Scum', '        We are an organization providing essential mercenary and security services throughout the Stanton System. Our focus is to help our clients build a successful and thriving business, despite the recent increase in pirate activity.\r\n\r\n        Whether from the ground, the air, or the cold vaccuum of space, you can find peace of mind knowing Nova Black will firmly place themselves between you, and the danger that finds you.\r\n\r\n	Any who wish to test their mettle, and earn UEC doing so, join the Nova Black; we\'ll see what kind of metal your made out of.', '', 0),
(12, '2017-06-21 03:05:37', 3, 'Protecting the Universe From Pirate Scum', '        We are an organization providing essential mercenary and security services throughout the Stanton System. Our focus is to help our clients build a successful and thriving business, despite the recent increase in pirate activity.\n\n        Whether from the ground, the air, or the cold vaccuum of space, you can find peace of mind knowing Nova Black will firmly place themselves between you, and the danger that finds you.\n\n	Any who wish to test their mettle, and earn UEC doing so, join the Nova Black; we\'ll see what kind of metal your made out of.', '', 0),
(13, '2017-06-21 03:07:16', 3, 'Protecting the Universe From Pirate Scum', 'A short message from Zanigade, founder of Nova Black.', '', 0),
(14, '2017-06-21 03:07:56', 3, 'Protecting the Universe From Pirate Scum', 'A short message from Zanigade, founder of Nova Black.', '', 0),
(15, '2017-06-21 19:50:44', 1, 'This is a test blog to test out the new text editor', '<p>This is an example of how it&#39;ll look. We can do things like <span style=\"font-family:Comic Sans MS,cursive\">change the font type</span>, <span style=\"color:#9b59b6\">change font colors</span>, add features like <strong>BOLD</strong> and <u>UNDERLINE</u>, etc... You can add photos within the blog post (I haven&#39;t tried this yet, idk how it&#39;ll work or IF it&#39;ll work lol)</p>\n', '', 0),
(16, '2017-09-17 16:12:05', 1, 'New Org Reporting', '<p><span style=\"font-size:18px\">In the latest line of development in what the leadership will be tracking, we have fund contributions. This will allow leadership to know who has been donating to the org, how much has been donated, and how much an org member has needed to receive from the org. This information will be tracked and updated by the NovaTreasury. While NovaTreasury will be the ones that can update the reporting, our org leadership will have the power to actually make the withdraws or ok the distribution of funds to specific divisions or members.</span></p>\n\n<p><span style=\"font-size:18px\">This is just one of the reporting tools offered for leadership to make sound decisions. Check out <a href=\"http://www.novabl4ck.org/blog/blogPost/17\">Ship Totals</a> or <a href=\"http://www.novabl4ck.org/blog/blogPost/18\">Skills Reporting</a> to see some of the other tools used to keep the org running smoothly.</span></p>\n', '/public/img/blogs/blog16img.jpg', 1),
(17, '2017-09-17 16:48:02', 1, 'Ship Totals', '<p><span style=\"font-size:18px\">Due to this new reporting tool <span style=\"color:#a5011a\">leadership</span> will be able to track what ships are owned by what members within their section. Division leaders will see all within the division while department leaders will see within their own departments only. This allows leadership to know what ships are available for use within the org and when creating missions, will assist in the ability to put together the <span style=\"color:#9b59b6\">perfect teams. </span>All of this is done so that when Nova Black is hired for any kind of mission, the right people are put on the job!<br />\n<br />\nTo see how else we make sure we put together the perfect team for your mission, check out <a href=\"http://www.novabl4ck.org/blog/blogPost/18\">Training Reports</a> and <a href=\"http://www.novabl4ck.org/blog/blogPost/19\">Mission Creation</a></span></p>\n', '/public/img/blogs/blog17img.jpg', 1),
(18, '2017-09-17 17:16:41', 1, 'Training Evaluations and Reporting', '<p><span style=\"font-size:18px\">As stated in previous blogs, we&#39;re constantly improving the way we track and report key information about members for leadership to ensure we place the perfect people for your mission on a team. The next topic we touch on will be skill levels. We all know all gamers aren&#39;t created equal. Some excel in dogfighting while others might e</span><span style=\"font-size:18px\">xcel in first person ground combat. It&#39;s our job to know where each players strengths (and weaknesses) are to make sure we have well balanced teams.<br />\r\n<br />\r\nAs it stands right now, the leader of our <a href=\"http://www.novabl4ck.org/services/service/1\">Tactical Division</a> evaluates each member on a fairly regular basis to see where their strengths and opportunities are. He takes detailed notes not only providing a numerical score but taking notes that are attached to each members profile (that only leadership can view). This allows a Division or Section leader to have some really good details while putting together their team for your mission! Again, all this is done to ensure success in what you hire us to do! This combined with our <a href=\"http://www.novabl4ck.org/blogs/blogPost/19\">Mission Signup</a> module and <a href=\"http://www.novabl4ck.org/blogs/blogPost/17\">Ship Reporting</a> along with some Org Secrets we won&#39;t be blogging about, is just proof that we are dedicated and able to ensure that whatever Nova Black is hired for, is an absolute success, EVERY TIME.</span></p>\r\n', '/public/img/blogs/blog18img.jpg', 1),
(19, '2017-09-17 18:08:13', 1, 'Mission Creation...', '<p><span style=\"font-size:18px\">The next important step to creating a perfect team is to make sure all people will show up! To do this, we look for volunteers for every mission. Based on what the customer has offered to pay/what kind of mission or package they have purchased from us, leadership will create a mission. When doing so, they will list what positions are needed, what ships are needed, when and where the mission will begin, how long it&#39;s expected to take, etc. Once the mission is created it will appear in every member&#39;s profile page as displayed in this blog. When they click on a mission, it will pop up with a display showing all the information and allow them to select which positions they are willing to do within that mission. Once that data is collected, the mission creater will go in, review the candidates, review their training stats, ships, etc and put together their team for that mission.<br />\r\n<br />\r\nThere should be absolutely no doubt that we put a lot of effort into every mission and ensuring it&#39;s success. Our tactical advisor will let you know if he feels the package you selected isn&#39;t sufficient enough to ensure success as well as let you know if you are selecting a bit of overkill. While we love making money, we want to make sure your missions with us are profitable so you continue to use Nova Black services. </span></p>\r\n\r\n<p><span style=\"font-size:18px\">If you missed some of our other blogs about how we make sure you get the perfect team for your mission, check out some of these links:</span></p>\r\n\r\n<p><a href=\"http://www.novabl4ck.org/blog/blogPost/18\"><span style=\"font-size:18px\">Training Evaluations</span></a></p>\r\n\r\n<p><a href=\"http://www.novabl4ck.org/blog/blogPost/17\"><span style=\"font-size:18px\">Ship Reporting</span></a></p>\r\n\r\n<p><a href=\"http://www.novabl4ck.org/blog/blogPost/16\"><span style=\"font-size:18px\">Org Fund Contributions</span></a></p>\r\n', '/public/img/blogs/blog19img.jpg', 1),
(20, '2017-09-21 16:12:50', 1, 'User Notes', '<p><span style=\"font-size:18px\">In the latest of tools to help keep our org organized as well as ensuring communication isn&#39;t a problem, we have enabled notes for users! This is a section where our leadership will be able to leave notes on a specific user allowing everyone to stay up to date. When selecting missions we will be able to view any notes on their training performances, previous missions, or just general notes about the user that leadership feels is worthy. Nobody besides Captain&#39;s and above will be able to view these notes. Training notes WILL be made public so that the user can view their feedback and work on areas of opportunity. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px\">This is just the latest effort to ensure excellent communication within the org to optimize performance and profits. To see other systems in place to achieve this, check out our <a href=\"http://novabl4ck.org/blog/blogPost/17\">Ship Totals</a>, <a href=\"http://novabl4ck.org/blog/blogPost/18\">Training Evals</a>, or our <a href=\"http://novabl4ck.org/blog/blogPost/19\">Mission Creation</a> blogs.</span></p>\r\n', '/public/img/blogs/blog20img.jpg', 1),
(21, '2017-09-21 17:24:43', 56, 'Nova Black Trailer!!', '<p><iframe align=\"top\" frameborder=\"1\" height=\"300\" scrolling=\"no\" src=\"https://www.youtube.com/watch?v=eRm27V1Y9nM\" width=\"500\"></iframe></p>\n', '', 0),
(22, '2017-09-22 20:59:54', 15, 'You\'re all gunna be Famous....eventually ', '<p>Whats up you buttercups! Its your boy Echo!&nbsp;Just giving everyone an update on the Series. 0% progress has been made after filming the first trailer. Woot! Still waiting on 3.0. hopfully i will find time in the next 2 weeks i have off to get some filming done for the next trailer, got the audio recorded for it at least. Should be able to shoot some epic action scenes once 3.0 comes out. That is what i have been waiting for for the past 4 months anyways. Should be fun!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>P.S. anyone with editing skills with audio/video would be a great help as i have no clue WTF im doing...&nbsp;<img alt=\"yes\" src=\"http://www.novabl4ck.org/public/js/ckeditor/plugins/smiley/images/thumbs_up.png\" style=\"height:23px; width:23px\" title=\"yes\" />&nbsp;Best of luck to everyone in the verse.</p>\r\n\r\n<p>P.S.S. There, i posted somthing in the blog section. Happy now Bdon!</p>\r\n', '', 0),
(23, '2017-09-22 21:01:42', 15, 'You\'re all gunna be Famous....eventually ', '<p>Whats up you buttercups! Its your boy Echo!&nbsp;Just giving everyone an update on the Series. 0% progress has been made after filming the first trailer. Woot! Still waiting on 3.0. hopfully i will find time in the next 2 weeks i have off to get some filming done for the next trailer, got the audio recorded for it at least. Should be able to shoot some epic action scenes once 3.0 comes out. That is what i have been waiting for for the past 4 months anyways. Should be fun!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>P.S. anyone with editing skills with audio/video would be a great help as i have no clue WTF im doing...&nbsp;<img alt=\"yes\" src=\"http://www.novabl4ck.org/public/js/ckeditor/plugins/smiley/images/thumbs_up.png\" style=\"height:23px; width:23px\" title=\"yes\" />&nbsp;Best of luck to everyone in the verse.</p>\r\n\r\n<p>P.S.S. There, i posted somthing in the blog section. Happy now Bdon!</p>\r\n', '/public/img/blogs/blog23img.jpg', 1),
(24, '2017-10-12 19:29:36', 1, 'This is a test blog, just to make sure everything works right! :/', '<p>Test blog, don&#39;t mind this at all. In fact, it&#39;ll prob be deleted before you can check it out lol.</p>\r\n', '/public/img/blogs/blog24img.jpg', 0),
