(26, '2019-12-04 18:46:34', 164, 'We call him: Pirhana!', '<p>With the introduction of the Pisces in the latest patch, a few of us have been experimenting with some upgrades to make this a more fun little toy.&nbsp; We replaced the stock guns with size-1 gimble mounts on all four hard-points and added a size-1 ballistic gattling gun on each gimble.&nbsp; While the ship is still a fragile little ship, doing bounties with it is fun and can easily take down a valkyrie or connie with little effort.&nbsp; And, given the size, it has a tiny little hitbox.&nbsp; And with a 5 minute reclaim time, if it does get destroyed, it&#39;s still quick and easy to grab a new one and go back to it!&nbsp; We will do more testing, perhaps with better shields, and report back.</p>\r\n', '/public/img/blogs/blog26img.jpg', 1);
