(1027, 'JoshuaAnype', 'semrushemails@gmail.com', 2, 3, 'Hi there, my name is Steve Mayernick. \r\nYou are probably thinking what the heck I am contacting you about! \r\nYou might be aware of me but in case you’re not, I am the head of a well known marketing company in the US.  I manage the big brands. \r\nLast year was all about my health so I made a health focused goal and nailed it but this year I decided to do something for others. \r\nSo I made a New Year’s Resolution to invest 10 minutes into helping one person a day for the entire year, it has been a fulfilling new year’s resolution indeed. \r\nToday I came across your site as I was working on one of your competitor’s marketing campaigns and when I saw your site I was impressed by the effort you have made and the thought and detail you have applied to the front end. \r\nHowever it is highly evident that you have not applied any time or knowledge into what I consider to be the most important part of your business. \r\nYour reach is lacking, without reach you are limiting your customer base. This is overwhelming for a lot of small businesses. \r\nFor me to help you by physically doing the work for you would cost you a lot and I am not here to do that. \r\nInstead I am giving you the biggest tip you will ever receive and something I do not share ever as it would put me out of business. \r\nYou can do this yourself. You don’t need to be an expert to be ranking with the big boys. \r\nAll of us marketing experts use tools, they do all the work we just navigate them and really it’s something anyone can do but we don’t tell our clients this. \r\nThis is the most effective tool used in the marketing world and what myself, my team and all of the experts in our industry rely on. \r\nhttp://seo-leader.tech/seo-tools \r\nIf you want to take your business to the next level this is the equivalent of hiring a solid marketing team, it is not difficult to use and it will give you a huge foot up on your competitors. \r\nAs I said you have set up everything on the front end perfectly so you will convert well once you get your reach right. \r\nI will check in on your progress from time to time. Hopefully I see you ranking for higher volume keywords and even out ranking my client! \r\nYou have everything you need, stay focused and you will get there. \r\n \r\nBest, \r\nSteve', 0),
