INSERT INTO `users` (`userid`, `handle`, `discord`, `password`, `email`, `img`, `shortBio`, `bio`, `firstName`, `lastName`, `accountCreation`, `bday`, `position`, `referredby`, `rank`, `status`, `message`, `approvedby`, `approveddate`, `newsletter`, `terms`, `blogupdatesemail`, `leadermessageemail`, `newfeatureemail`, `newmission`) VALUES
(1, 'bdon', '310955269251137536', '3dbe8537d3bf4c5f80f036af7e3476b364096467', 'brandonvinall@gmail.com', '/public/img/selfie/bdonSelfie.jpg', '<p><strong><span style=\"color:#cc66cc\">BDON</span></strong> started out his career with the <strong><span style=\"color:#ff0033\">UEE Army</span></strong>. He battled the Vanduul in Vega along with several classified battles not in open record. He worked his way up to the rank of <span style=\"color:#000000\">captain b</span>efore leaving the Army and settling in <span style=\"color:#000000\">Sol f</span>or a bit.</p>\r\n', '<p>BDON was born and raised in the Orion system on the planet Armitage. His parents were originally in the military but settled into farming to raise him and his sister. They settled mostly because they didn&#39;t want the military lifestyle for them but it didn&#39;t work out as planed. Being in a system with constant attacks from the Vanduul seemed to spark B-Don&#39;s interest in the military and he became heavily invested in joining the fight. On his 16th birthday, he woke up early and made his way to the city and to the local recruitment center and filled out the paperwork. He was informed of a shuttle leaving that evening to take new recruits to training, or he could wait until the following week. He was stoked to get his new life started so he started to head back home. And that&#39;s where everything changed. He got on his bike and the engine craped out on him so he had to walk 25 km back home. As he was walking and jogging he kept noticing strange things happening around him. People were packing their vehicles and leaving everywhere. There was a mass panic everywhere he went.</p>\r\n\r\n<p>About 10 km out someone ran into him and knocked him over. He stood up, picked the man up and was about to hit him when he noticed he was a neighbor of his by the name of scott. B-Don asked Scott what the hell was happening and he said the Planet is under attack! Before he had the chance to ask &quot;What!?&quot; A Vanduul Glaive made a fly by and one of the shots hit the ground near him, send him flying; knocking him out on a light post. As he came to, he had to push Scott off of him. He rolled off easy because his legs were missing and his back was burnt to the bone. He took most of the blast, sparing B-Don. He then realized Scott was running away from his house and he began to worry about his family. He picked up the pace and made his way back home through the wreckage and bodies. He even had to dodge a couple vanduul patrols. Once he made it out of the city, he had a clear shot home as most of the vanduul were pushing into the city and had already taken care of the outer city limits. He passed farm after farm and could see nothing but burnt fields and destroyed homes. Deep down, he knew what to expect. When he got there, he couldn&#39;t tell. It wasn&#39;t any different From the 30 other farms he passed. The field was nothing but ash as was the house. Completely vaporized. He never found any bodies. He realized the only way off this planet was that shuttle and it was leaving in an hour. Shit, it was back in the city center. He wouldn&#39;t make it on foot so he found the old beater car in the shed him and his dad were working on and tried to turn it on after a couple tries and a couple tweaks of the engine she turned over and roared to life. She didn&#39;t have a muffler so everywhere he went sounded like a machine gun going off. He pinned it and drove as fast as this old thing would take him.</p>\r\n\r\n<p>Driving up to the city he noticed the vanduul were quickly closing in on the city center. As he was breaking through the back of the vanduul lines he took a hit from some stray shots. He broke through the line but the bullet broke through a major artery in his arm and he was bleeding bad. He made it to the UEE defense line and skid to to a hault. He booked it behind cover, holding his arm. He arrived just as they were falling back to their shuttles, so he hopped on the back of a dragonfly and got a ride to the shuttle. All the civilians were cramming themselfs into the shuttles as best they could but there wasn&#39;t enough shuttles for everyone. B-Don was put in his shuttle and was the last one in before they closed the doors and took off. Looking out the window, he watched as the rest of the shuttles took off; leaving behind hundreds of civilians and soldiers alike. And that&#39;s when the vanduul broke through one of the lines.</p>\r\n\r\n<p>Like a tital wave they flooded into the area and had no mercy. He watched as they began mowing down hundreds of men woman and children without any hesitation. A couple of the shuttles got shot down as well before he blacked out from blood loss. After he broke atmosphere and made his way to one of the UEEs last capital ships, there was only 2 or 3 shuttles left.</p>\r\n\r\n<p><br />\r\nHe woke up in the infirmary a couple days later in the Vega system. The fleet pulled out and he was one of the few who made it out. Once he recovered he wasted no time getting trained. He battled the Vanduul throughout his training in Vega along with battles in <span style=\"color:#000000\"><span style=\"background-color:#000000\">@#LK$</span></span> and <span style=\"color:#000000\"><span style=\"background-color:#000000\">QERJ@</span></span> serving under <span style=\"color:#000000\"><span style=\"background-color:#000000\">@#L$KJ@#</span></span> <span style=\"color:#000000\"><span style=\"background-color:#000000\">@#$Jl</span></span>, all of which are classified battles not in open record. He worked his way up to the rank of Captin. Many missions crossed paths with &quot;project <span style=\"color:#000000\"><span style=\"background-color:#000000\">@KD@#$!Ss </span></span>&quot;. before leaving the Army and settling in Sol for a bit. He did some side jobs to pass the time as retirement didn&#39;t suit him and became a contractor working for a supply and trading company.&nbsp; While traveling he met Zanigade in Stanton and agreed to come aboard as his Tactical Advisor. The rest, well that&#39;s history in the making my friends......</p>\r\n', 'Brandon', 'Vinall', '2017-05-16 16:16:38', '0000-00-00', 6, 0, 7, 1, '', 1, '2017-05-16 16:18:24', 0, 0, 1, 1, 0, 1),
