(15, 'Nightecho419', '', '6db469a6ffa9f8b80278cd5d6869075d2223a498', 'logandev@gmail.com', '/public/img/selfie/Nightecho419Selfie.jpg', '<p>Born into a Military family, he grew up with discipline and a lot of training. He&nbsp;has done a lot of Mercenary&nbsp;work for all of his working life. That was until he came across Zanigade in boot camp and been working with him ever since.</p>\r\n', '<p>{Details will be released during the first season of Nova Black Adventures}</p>\r\n', 'Devin', 'Logan', '2017-05-19 18:37:32', '0000-00-00', 1, 0, 2, 1, '', 3, '2017-05-19 18:38:48', 0, 0, 1, 1, 1, 1),
(16, 'Abdiah', '', 'bcc54e3d2b1a2909e3c1a24a68bc505db46c3674', 'atwood.dallan@hotmail.com', '/public/img/abdiahSelfie.jpg', '<p>Abdiah Rosser is from Shorvu, Rihlah. He joined the Nova when he was 17 years old and has been serving for over 5 years. Abdiah oversees translations under the intel divison and mainly deals with any Xi&#39;an contracts.</p>\r\n', '<p>Abdiah Rosser /&#39; Ahb-die-uh \\ Raws-er/ was born on Terra, but spent his life growing up on the planet Shorvu under the Xi&#39;an Empire in the Rihlah system. His parents had taken him there as political refugees, but raised him as successful engineers. Abdiah attended the most prestigious of universities where he studied computer sciences and Human-Xi&#39;an communications. But he always aspired to be more than just a four-eyed geek. Nova first came to Abdiah at the age of 17. His family was under attack by local pirates in the heart of the Oso system when Nova intervened. After witnessing ignorance be dispelled by raw power and skill, Abdiah begged the crew to join them. After months of applications, he finally stepped afoot his first Nova vessel. He never made his way up fast; they kept him in the dark. Each time they were off on missions, instead of mopping the corridors, Abdiah would practice in the shooting range or sprinting laps around the ship. After a shift in leadership, Abdiah quickly made his way up the ranks as his full potential was acknowledged. At first a mop boy. Then he became one of the intel-cargo boys. Soon after that, Abdiah became one of the organization&#39;s first translators as their reaches gripped further around the known &#39;verse. His ties with the Xi&#39;an and ability to gain their trust forced him to the rank of Lieutenant at such a young age.</p>\r\n', 'Dallan', 'Atwood', '2017-05-28 12:19:11', '0000-00-00', 14, 0, 2, 1, '', 3, '2017-05-28 12:24:14', 0, 0, 0, 0, 0, 0),
