(24, 'Ph01n1x', '276503397161500672', 'b85c9167770e5fb1886f37ea5cd3c169245a0b9f', 'gabriel_stelmach@hotmail.com', '/public/img/Ph01n1xSelfie.jpg', '<p>Living at the border of Empire had the first contact with Nova when his ship broke at mid of nothing and Nova&#39;s Admiral Zanigade saved him from cold death. Ph01n1x has exploration in his blood and offers It to the Intel.</p>\r\n', '<p>Ph01n1x was born on Earth, the last son of an important merchant family had to move out the Solar System due to privacy issues, since then his family name was abandoned.</p>\r\n\r\n<p>Living at the border of Empire had the first contact with Nova when his ship broke at mid of nothing and Nova&#39;s Admiral Zanigade saved him from cold death. Ph01n1x has exploration in his blood and offers It to the Intel division.</p>\r\n', 'Gabriel', 'Stelmach', '2017-05-31 06:23:37', '0000-00-00', 3, 0, 2, 1, '', 3, '2017-05-31 06:25:04', 0, 0, 0, 0, 0, 0),
