(32, 'Tox2', '', 'fa2ca509fa3e8098fef64564b46dfb0c51900932', 'jpdhay@gmail.com', '', '', '', 'Derek', 'notgettingthis', '2017-06-28 15:59:06', '0000-00-00', 3, 0, 5, 1, '', 1, '2017-06-28 16:02:09', 0, 0, 0, 0, 0, 0),
(33, 'lrwhittaker48', '155023838101372929', 'a199bdce492860245e97224bc449e28235257aa5', 'lrwhittaker48@gmail.com', '/public/img/selfie/lrwhittaker48Selfie.jpg', '<p>Name&#39;s logan, Im a mercenary for Nova Black but also daddle in other jobs and markets. All you really need to know is that if you&#39;re ever working with me, they were a team. Meaning no one gets left behind. I&#39;ll push you to your limits, and in doing so, I expect you to punch&nbsp;me to mine.</p>\r\n', '<p>I was born on the outer-lying star known as Ayr&#39;ka on planet Ayr&#39;ka I. Officially marked as Non-habitable, this planet was used as a training ground for&nbsp;experiments. Being hidden made it easy for the Xi&#39;an to treat us terribly, conducting tons of experiments and feeding us the bare minimum. At birth, we were taken from our family&#39;s and thrown into chambers along with 3 others. In my group, there was me, a boy named Dan, a girl called Lily, and Rose. When we turned 5 they began our tests. We were sent into a large open room and told, &quot;you will be in here for 5 hours. If at the end of if you&#39;re still alive, you can see your families.&quot;</p>\r\n\r\n<p>The sound disappeared and the room opened at the back wall, revealing a massive forest, with hills and the sound of flowing water. We were all confused but I quickly realized that this wasn&#39;t a normal, wait 5 hours. I told them that we needed to find a good place to set-up, somewhere easy to defend and with a good lookout over the land. As we were searching we heard a low snarl and saw something terrifying. A large black beast, with dark yellow eyes and claws as sharp as titanium. That was when I realized that, this wasn&#39;t our test. It was for these animals.</p>\r\n\r\n<p>We ran up to the top of a waterfall where we found a good open flat place to set up. With the drop behind us and only a small entrance, it would be easy to defend. After 5 hours had passed we had set up a small shelter and a couple spears with which to defend ourselves. Dan then spoke up saying &quot;Why are we doing so much, 5 hours have passed and we&#39;ll be free soon&quot;<br />\r\n&quot;Actually, you&#39;re wrong, 6 hours have passed&quot; I responded.<br />\r\n&quot;So, whats the difference&quot;<br />\r\n&quot;The Difference is that they said 5, and they seem to be on a tight schedule.&quot;<br />\r\n&quot;Meaning what exactly?&quot;<br />\r\n&quot;Meaning we&#39;re never getting out of here. This isn&#39;t our test. It&#39;s to test out those Creatures that we saw. They&#39;ll leave us in here until we either die or make them stop the test to redesign.&quot;<br />\r\nLily and Rose looked at me in horror, Dan opened his mouth but couldn&#39;t get the words out to say anything. We were all terrified, knowing that we were here to die, to be feed to things that aren&#39;t even natural. We were Mice, trapped between the paws of a cat.</p>\r\n\r\n<p>We stayed there for 12 years, slowly building up and expanding our wall. When we were 17 Dan and Lily had a baby girl, who they named Sky. Times were peaceful and nice after we found out that the Darnen, that&#39;s what we called the beasts, were afraid of a type of mold growing on the rocks. We discovered that it was poison if it touched them, so we started building with it, layering it on our walls, spears, and houses. Eventually, we had a little town, everyone playing and working. Dan and Lily later had twins, Jack and Josh.&nbsp;</p>\r\n\r\n<p>As time progressed we began to learn more about how to create things, eventually I and Dan made our first firearm, a very simple pistol, because of our growing up in such an advanced place, we knew a lot about how things worked. Dan was used as a mechanics servant when he was too young to be testing, so he knew the most out of all of us. Slowly over time, we began to climb, accelerating later to building things like lights, and generators, even creating a few turrets on the walls of our base.&nbsp;</p>\r\n\r\n<p>Another year passed, Rose and I were out exploring the land, past where we&#39;d ever gone before. There we found a massive ravine, with only a rock bridge connecting the two side for what seemed like miles. Behind us we heard the creatures closing in, so we quickly jumped down to a ledge and hid. What surprised us though was that they didn&#39;t come for us. They came for what was on the other side. From the forest emerged a couple of large white beasts. They looked like Direwolves. The two creatures seemed to converse before the black ones attacked over the ravine. After an hour the fight seemed to have ended. When we came up from the ledge we found trees destroyed, rocks broke, and bodies, bodies everywhere. Rose buried her head into my shoulder as we walked over the battlefield. We heard a whimpering coming from on of the rocks and ran over to see a tiny dire wolf pup, lying under one of the rocks. When I first picked him up he cried out and whimpered, trying to bite me, but soon curled up in my arms realizing that everyone it knew, was now dead.</p>\r\n\r\n<p>We took the dire wolve home and brought him into the town. We healed him and raised him as our own, nurturing him back to health. As he grew older he played a lot with the kids, eventually saving Sky, who was playing outside of the wall, when an adolescent Darnen attacked her.</p>\r\n\r\n<p>3 more years passed, we had now been here for 16 years, and were 21. We were all down at one of the valley&#39;s cliffside edges celebrating Rose&#39;s 21st birthday. Dan pulled out a big box and said it was explosive, he rigged it to the wall of the mountain and said. &quot;happy birthday rose.&quot; The bomb pulsated a beautiful white, purple, and black. An orb formed in the middle and expanded far out, then contracted inward, dissipating into nothingness. Left behind from the explosion was a hole in the rock, but past that, we saw something terrifying. A large corridor running behind the rock. We took everyone and walked into it, following it through until we reached a room entitled, &quot;control room&quot;. When we entered we discovered that all these years. All this time. We were being watched. On one of the computer&#39;s we saw a file titled, &quot;If you ever escape, read this&quot;</p>\r\n\r\n<p>In the file, we found a message to, us. The message read. &quot;If you&#39;re reading this then that means you escaped the experiment, how I don&#39;t know, but congrats. You were placed in there 1 year ago, and today the experiment is being canceled, but they not letting you go. They&#39;ve killed off all the other subjects but I convinced them to leave you for the creatures. They agreed and left. I wanted to free you but knew you&#39;d just be shot if I did. So I had to leave. I hope you make it out soon. All I&#39;d ever wanted to say to you, since the beginning was that, no matter what you think I am, and how horrible you think I am, I just want you to know that, through everything, I&#39;m Sorry.&quot;</p>\r\n\r\n<p>And that was all. All these years, we had just been left here! Filled with anger we continued, following the lines on the wall to the hanger bay. We boarded a freelancer and took off. As the computer flew us away Dan put something in front of us all. A button. &quot;Before we left, I put that explosive in the &#39;Core room&#39;.&quot; We knew what that meant, and as we slowed the ship and pointed it toward the planet, we watched as all four of us pressed the button together. The planet lit up in a bright, yet beautiful purple light, and shattered, exploding in a peaceful harmony of rocks moving as though they had always wanted to. Through everything that had happened, I&#39;ll always remember one thing from that place, three words I could now say.<br />\r\nI Forgive You.</p>\r\n', 'Logan', 'Whittaker', '2017-06-28 19:57:07', '0000-00-00', 1, 0, 2, 1, '', 3, '2017-06-28 19:58:34', 0, 0, 0, 0, 0, 1),
(34, 'DerkDodgers', '329703564102467584', 'c6525b7d5214c6eb016c01c88ee67285f53e09ff', 'trask.derk@gmail.com', '/public/img/selfie/DerkDogersSelfie.jpg', '<p>At the age of 10 he was forgotten by his mother near a massive junkyard. Learning to scrap and build was essential to survival. Now, Derk Dodgers is head of the salvage department for the merc org Nova Black.</p>\r\n', '', 'Derek', 'Faircloth', '2017-06-29 13:14:29', '0000-00-00', 13, 0, 7, 1, '', 1, '2017-06-29 13:15:06', 1, 0, 1, 1, 1, 1),
