(46, 'Righteous_load', '320676423268302849', 'f0bd8e8526e9aa28c54b4ca1999f995b32702da3', 'josephgalindo@gmail.com', '/public/img/selfie/Righteous_loadSelfie.jpg', '<p>Code name Righteous Load from the planet Uriel in the Oberon system. Was recruited into Nova Black when a stow away had crept into his ship and recruited him in the organization<br />\r\nwhere he quickly rose through the ranks to his current position as Lieutenant of Exploration.<br />\r\n&nbsp;</p>\r\n', '<p>Code name Righteous Load from the planet Uriel in the Oberon system. He was raised by his mother alone after she had left his father for being an alcoholic and they lived under the planet surface due to a failed terra-forming experiment from the UEE. When he was old enough to leave Uriel, and had saved enough money for his own ship, he left his depressing planet to find a new home. He was always a lone wolf so wondering the stars alone never really bothered him. He saw all sorts of different alien races on all sorts of different planets, while Searching the known universe and taking freelance cargo hauler/explorer jobs to fund his expedition. He quickly learned just how cold and heartless the universe really is and had to adapt accordingly. While making a quick stop at Port Olisar for refuel, repair, and looking for the next job, a stow away had crept into his ship and recruited him into the Nova Black organization. Righteous Load figured he would never really find a home quit like his ship and having a constant job with Nova Black had more benefits than just going about it solo. Nova Black welcomed him with open arms and he finally started to feel at home within the org.&nbsp; He joined the Intel Division because exploring new territories and gathering intel was a perfect fit for him and has since stayed with Nova Black working his way up the ranks to where he currently is a lieutenant in exploration.</p>\r\n', 'Joe', 'Galindo', '2017-07-07 22:07:21', '0000-00-00', 3, 0, 3, 1, '', 3, '2017-07-07 22:08:08', 1, 0, 1, 1, 1, 1),
