(65, 'Uchiyama1388', '', '2ab483fccf1efbd84a81c41ab2da3b0a2170f5da', 'allylbrewer92@gmail.com', '', '', '', 'Ally ', 'Brewer', '2017-07-21 15:06:20', '0000-00-00', 10, 46, 5, 1, '', 46, '2017-07-21 15:08:51', 1, 1, 0, 0, 0, 0),
(66, 'Guardian-Of-Space', '206143404478955520', '8ec85e26278ddcfc93b20f4497e7dbe7aec1bf21', 'alex199199@hotmail.ca', '/public/img/selfie/Guardian-Of-SpaceSelfie.jpg', '<p>Guardian is highly athletic, a skilled marksman and swordsman, and proficient at hand-to-hand combat. After overcoming his lifetime of hatred, Guardian took a vow to never take another life unless absolutely necessary. His greatest asset is his partner and would-be lover, his ship.</p>\r\n\r\n<p>His real name still remains a mystery today... People call him Guardian for short, or as close friends call him...GoS</p>\r\n', '<p>When J&#39;sons ship crash lands on Earth, he is taken in by Meredith Quill. The two form a relationship while J&#39;son makes repairs to his ship. Eventually, J&#39;son is forced to leave to return home and fight in a war. He leaves, not knowing Meredith is pregnant with Guardian. 10 years later, Meredith is killed when she is attacked by two soldiers who have come to kill Guardian and end J&#39;son&#39;s blood line. Guardian kills them with a shot gun, finds his father&#39;s gun by accident, and escapes his home before it is destroyed by the soldiers ship. The soldiers presume Guardian is killed and leave. Guardian is placed in an orphanage and eventually joins NASA.</p>\r\n\r\n<p>Later, when his ship malfunctions and he is stranded in space,&nbsp;Guardian is found by the Scavengers, a group of space pirates led by Yondu. After the Scavengers saved Guardian, he tried to steal their ship. Guardian managed to outsmart every member of the Scavengers and even knocked out Yondu before capturing him. After he woke up, Yondu managed to set himself free from his restraints and attacked Guardian and gave him a choice between letting himself be released to space without more trouble or get killed right there. Guardian instead asked him if he could join his crew. Yondu was not sold on the idea but after he found out Guardian was like him as they were both &quot;kids without homes&quot;, Yondu changed his mind and let him stay in the ship with the Scavengers as their cleaning boy. Guardian decided to stay and try to learn everything he could from space while he was part of the Scavengers and led him to where he is now.</p>\r\n', 'Guardian', '  ', '2017-07-22 08:59:26', '0000-00-00', 13, 34, 2, 3, '', 1, '2018-04-25 16:56:42', 0, 1, 0, 1, 1, 1),
