(75, 'TimLarson', '', '8bb8f262f61c2463ec68f210990ceca8a34312ce', 'simonejonah@gmail.com', '/public/img/selfie/TimLarsonSelfie.jpg', '<p>Hi, my name is Tim Larson, but my close freinds call me Blitz. My hobbies are flying, rescuing, and collecting ship models from time to time! Hit me up if you wish to talk!</p>\r\n', '<p>Tim was originally bron on Trise, The holy place for the Banu. Due to the fact that the councle resides there, it is very far away from any civilization, and for most of his&nbsp;childhood had no understanding of the rest of the universe&nbsp;other then what information came from the trading ships.&nbsp;Because of the main export being medical, Tim&nbsp;was able to train and learn from the doctors there.&nbsp;This gave him&nbsp;the ablilty to be quite formidable in surgery&nbsp;and being a good person under pressure. Unfortunatly because of how isolated Trise is, they didn&#39;t want people leaving&nbsp;so he&nbsp;was able to sneek onto a trading ship&nbsp;and was able to get to the&nbsp;planet Stanton III, home of Arc Corp. From there he&nbsp;had&nbsp;been taking jobs every now and then&nbsp;from medical to bounty hunting.&nbsp;He was&nbsp;been too scared to leave the planet since he&nbsp;knew nothing else but the Banu&#39;s teachings. Luckily he&nbsp;came across a man named Keeves who recruited him&nbsp;into the Nova Black orgonization. Since then Captain Bdon has been teaching him&nbsp;about the universe, and what he&nbsp;can do to help the orgonization. Now he is&nbsp;a doctor&nbsp;helping in search and rescue mostly, but is&nbsp;willing and able to do whatever is required of him. His&nbsp;flying skills are not the best, but from his&nbsp;bounty hunting days he&nbsp;was taught by the infamous &quot;Red Raider&quot;&nbsp;to become proficient in subduing and capturing targets. He is very open and is willing to awnser any questions you have for him.</p>\r\n\r\n<p>and no, he&nbsp;won&#39;t reveal Red Raider&#39;s identity.</p>\r\n', 'Jonah', 'Simone', '2017-07-26 14:31:10', '0000-00-00', 10, 30, 5, 1, '', 3, '2017-07-26 14:32:34', 0, 1, 0, 0, 1, 0),
